import React from 'react'
import {AboutContainer,Img} from './AboutElements'

const About = () => {
    return (
        <AboutContainer>
            ABOUT ME
            <Img src="../images/ABOUT.svg"/>
        </AboutContainer>
    )
}

export default About;
